var dpr = window.devicePixelRatio || 1;
var w = window.innerWidth;
var h = window.innerHeight;
var aspect = w / h;

function detectDevice() {
  const userAgent = navigator.userAgent.toLowerCase();
  
  // iPhone detection (iOS but NOT iPad)
  if (userAgent.includes('iphone') || 
      (userAgent.includes('ios') && !userAgent.includes('ipad'))) {
    return 'iPhone';
  }
  
  // iPad detection (explicit iPad OR Macintosh with high touch points)
  if (userAgent.includes('ipad') || 
      (userAgent.includes('macintosh') && navigator.maxTouchPoints > 4)) {
    return 'iPad';
  }
  
  // Android Phone detection (small screen or explicit mobile indicator)
  if (userAgent.includes('android') && userAgent.includes('mobile')) {
    return 'AndroidPhone';
  }
  
  // Android Tablet detection (Android but NOT mobile, or explicit tablet)
  if ((userAgent.includes('android') && !userAgent.includes('mobile')) ||
      userAgent.includes('tablet')) {
    return 'AndroidTablet';
  }
  
  // Mac (non-touch, non-iPad Macintosh)
  if (userAgent.includes('macintosh')) {
    return 'Mac';
  }
  
  // Windows
  if (userAgent.includes('windows')) {
    return 'Windows';
  }
  
  return 'Desktop';
}

const device = detectDevice();
console.log(`Device Detected: ${device}`);

// Set UI based on device type
